# 1 "LexerSpecification.fsl"
 
module LexerSpecification
open System
open ParserSpecification
open Microsoft.FSharp.Text.Lexing

let lexeme lexbuf =
    LexBuffer<char>.LexemeString lexbuf

let upperName (s : string) =
    NAME (s.ToUpper())

let upperError (s: string) =
    let error = s.ToUpper()
    match error with
        | "#DIV/0!"
        | "#NAME?"
        | "#NULL!"
        | "#NUM!"
        | "#REF!"
        | "#VALUE!" -> ERROR (error)
        | _ -> ERROR "#PARSE!"

let upperR1C1 (s : string) =
    R1C1 (s.ToUpper())

let fixQuotes (s : string) =
    let s' = s.[1..String.length s - 2]
    let s'' = s'.Replace("\"\"", "\"")
    STRING s''

let fixSheet (s : string) =
    let s' = s.[0..String.length s - 2]
    SHEETNAME s'

let fixAposSheet (s : string) =
    let s' = s.[1..String.length s - 3]
    SHEETNAME s'

